import React from 'react'
import alunos from '../../data/alunos'

export default (props) => {


    const li1 = (
        <li>
            {alunos[0].id}) {alunos[0].nome} -&gt; {alunos[0].nota}
        </li>
    );

    const alunosLI = alunos.map((aluno) => {
        return(
            <li key={aluno.id}>{aluno.id}) {aluno.nome} -&gt; {aluno.nota}</li>
        );
    });
    return (
        <div>
            <ul>
                {alunosLI}
            </ul>
        </div>
    );
}
